<html>
    <head>
        <meta http-equiv="Content-Type" content="text/html; charset=UTF-8"/>
		<script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js" ></script>
        <script src="https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.3.4/html2canvas.min.js"></script>
		<script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.6.4/jquery.min.js"></script>
        <script>
		
		$( document ).ready(function() {
			console.log(JSON.parse($.urlParam("pedido")));
			console.log(JSON.parse($.urlParam("itens")));
			var pedido = JSON.parse($.urlParam("pedido"));
			var total = JSON.parse($.urlParam("total"));
			var itens = JSON.parse($.urlParam("itens"));
			$("#nome").text(pedido[0].nome)
			$("#convidados").text(pedido[1].convidados)
			$("#data").text(pedido[3].data)
			$("#local").text(pedido[2].local)		
			$("#total").text("Total: R$ "+total)	
			for(var i of itens){
				console.log(i)			
				var t = $('<tr>                   '+
                    '<td style="padding: 10px; font-size: 22px;">'+i['Descrição']+'</td>  '+             
                    '<td style="text-align: center; padding: 10px; font-size: 22px;">'+i['crf79_quantidade']+'</td>   '+                                
                    '<td style="text-align: center; padding: 10px; font-size: 22px;">'+i['Preço'].toLocaleString('pt-BR',{ minimumFractionDigits: 2 })+'</td>  '+ 
                    '<td style="text-align: center; padding: 10px; font-size: 22px;">'+i['Total'].toLocaleString('pt-BR',{ minimumFractionDigits: 2 })+'</td>'+
                '</tr>')
				$("#tabela").append(t)			
			}
			window.jsPDF = window.jspdf.jsPDF;
			capture ();
		});
		
		$.urlParam = function(name){
			var results = new RegExp('[\?&]' + name + '=([^&#]*)').exec(window.location.href);
			if (results==null) {
			   return null;
			}
			return decodeURI(results[1]) || 0;
		}
		
		
		
        function capture () {
          html2canvas(document.body).then( function (canvas) {
            var base = canvas.toDataURL("image/png");
            let a = document.createElement("a");
            a.download = "orcamento.png";
            a.href = base;
            //a.click(); // MAY NOT ALWAYS WORK!
            var image = document.createElement('img');
            image.addEventListener('load', function() {
                
                var largura_mm = image.width;
                var altura_mm = image.height;
               
                var doc = new jsPDF('p', 'px', [largura_mm, altura_mm]);
                console.log(doc.internal.pageSize);
                let width = doc.internal.pageSize.width;
                let height = doc.internal.pageSize.height;

                doc.addImage(canvas.toDataURL("image/png"), 'PNG', 0, 0,width,height);				
                //doc.save('orcamento'+new Date().getTime()+'.pdf');
				window.open(doc.output('bloburl'))
				try{
					var file = new File([doc.output('bloburl')], "orcamento.pdf", {type: 'pdf/pdf'});
					var filesArray = [file];

					if(navigator.canShare && navigator.canShare({ files: filesArray })) {
					  navigator.share({
						text: 'some_text',
						files: filesArray,
						title: 'some_title',
						url: 'some_url'
					  });
					}
				} 
				catch(){
				}
				
            
            });
            image.src = base;
            
          });
        }
       
        </script>
    </head>
